import "./App.css";
import Tesseract from "tesseract.js";

Tesseract.recognize(
  "https://tesseract.projectnaptha.com/img/eng_bw.png",
  "eng",
  { logger: (m) => console.log(m) }
).then(({ data: { text } }) => {
  console.log(text);
});

function App() {
  return (
    <div className="App">
      <h1>Hello React!</h1>
    </div>
  );
}

export default App;
